import React from "react";
import "./Home.css";
import ThisWeek from "../components/Homepage/ThisWeek";
import Hours from "../components/Homepage/Hours";

const Home: React.FC = () => {
  const completedDays = ["Sun", "Mon", "Tue", "Thu"];

  const hoursData: { [day: string]: number } = {
    Sun: 5,
    Mon: 2,
    Tue: 3,
    Wed: 0,
    Thu: 5,
    Fri: 0,
    Sat: 0,
};

const totalHours = Object.values(hoursData).reduce((sum, hours) => sum + hours, 0);

  return (
    <div className="container">
            <header className="header">
                <h1>Welcome Jane</h1>
                <div className="header-icons">
                    <i className="icon-calendar"></i>
                    <i className="icon-bell"></i>
                </div>
            </header>

            <div className="section">

                <ThisWeek completedDays={completedDays} />
            </div>

            <div className="section">

                <Hours hoursData={hoursData} totalHours={totalHours} />
            </div>
        </div>
  );
};

export default Home;
